import React from 'react';
import Nav from './components/Nav';
import { Route } from 'react-router-dom';
import About from './components/About';

const App = () => {
  return (
    <div>
      <Nav />
      <Route path="/about">
        <About />
      </Route>
    </div>
  );
}

export default App;
